  input: 'TEXT,F3XA,,"Response to letter dated March 16, 2005, period covered: 5/01/04-5/30/04.  This
    response follows each bullet point.  The expenditure for printing literature pieces
    was an exempt activity undertaken by the Democratic Party of SC.  This activity
    promoted the Inez Tenenbaum for US Senate campaign, but was not a direct contribution
    to the campaign, and should therefore not count against the direct contribution
    limit.  The payment to Huttleston Data Design was for the software/database to
    establish a voter file system for the Democratic Party of SC.  This was an administrative
    expense to begin a system.  This expenditure was a non-FEA related payment.  The
    question concerning the ''apparent in-kind contribution made on behalf of a federal
    candidate'' relates to the very same exempt expenditure addressed in the first
    bullet point of this letter.  This activity promoted a federal candidate, but
    did so within the bounds of an exempt activity, therefore reporting on Line 21(b)
    should be correct.  I appreciate you providing the pertinent information (including
    the sample in-kind contributions reporting guidelines) with your letter.  We strive
    to accurately and timely file, and meet our reporting requirements."'
